import React from 'react';
import Item from './Item'


const ItemList = ({productos}) => {
        return (
            <div>
                <div id='Productos' style={{}}>
                {productos.map((item)=>
                <div>
                    <Item Id={item.Id} precio={item.precio} title={item.precio} descripcion={item.descripcion} img={item.img} stock={item.stock}/>
                </div>   
                )}   
                </div>


            </div>
        )
} 

export default ItemList;
